import React from 'react';

const LoginForm = () => {
  return (
    <div className="flex items-center justify-center min-h-screen bg-gray-100">
      <div className="relative bg-white rounded-3xl shadow-xl p-10 max-w-sm w-full">
        
        {/* Abstract Background Shape */}
        <div className="absolute top-0 left-0 w-full h-40 bg-gradient-to-r from-pink-400 via-purple-500 to-yellow-400 rounded-t-3xl -z-10"></div>
        
        {/* Welcome Text */}
        <h2 className="text-2xl font-bold text-gray-900 mt-12">Welcome Back</h2>

        {/* Email Input */}
        <div className="mt-8">
          <input
            type="email"
            placeholder="Email"
            className="w-full px-4 py-2 border border-gray-300 rounded-lg focus:outline-none focus:ring-2 focus:ring-purple-500"
          />
        </div>

        {/* Password Input */}
        <div className="mt-4">
          <input
            type="password"
            placeholder="Password"
            className="w-full px-4 py-2 border border-gray-300 rounded-lg focus:outline-none focus:ring-2 focus:ring-purple-500"
          />
        </div>

        {/* Sign In Button */}
        <button className="mt-8 w-full bg-purple-500 text-white py-2 rounded-lg hover:bg-purple-600 transition-all">
          Sign in
        </button>

        {/* Additional Links */}
        <div className="flex justify-between mt-4 text-sm text-gray-600">
          <a href="#" className="hover:underline">Sign up</a>
          <a href="#" className="hover:underline">Forgot Password?</a>
        </div>
      </div>
    </div>
  );
};

export default LoginForm;
